def get_stock_name(symbol):
    # Strip suffix for fuzzy lookup if exact match fail
    if symbol in STOCK_NAMES:
        return STOCK_NAMES[symbol]
    base = symbol.split('.')[0]
    return STOCK_NAMES.get(base, "")
